    <a href='https://drive.google.com/u/0/uc?id=19gsyfVi5YX3AwfjXj97PE4hYnQI6JNaY&export=download'>
Download
    </a>
    <Link to="https://drive.google.com/u/0/uc?id=19gsyfVi5YX3AwfjXj97PE4hYnQI6JNaY&export=download">
     <button type="button">
          Click Me!
     </button>
 </Link>
    </>
    );
}

export default Dummy;
